  salinity and other variables collected from time series observations using Bubble
  type equilibrator for autonomous carbon dioxide (CO2) measurement, Carbon dioxide
  (CO2) gas analyzer and other instruments from MOORINGS in the South Pacific Ocean
  from 2005-07-04 to 2011-02-04 (NODC Accession 0100078)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-29T01:37:20.121370\",\n\t\"name\": \"partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-time\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0100078 includes time series
  data collected from MOORINGS in the South Pacific Ocean from 2005-07-04 to 2011-02-04.
  These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON
  DIOXIDE, OXYGEN - PERCENT SATURATION, Partial pressure (or fugacity) of carbon dioxide
  - atmosphere, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY
  and SEA SURFACE TEMPERATURE. The instruments used to collect these data include
  Bubble type equilibrator for autonomous carbon dioxide (CO2) measurement and Carbon
  dioxide (CO2) gas analyzer.nnThese data were collected by Adrienne Sutton, Christopher
  Sabine, Stacy Maenner and Sylvia Musielewicz of US DOC; NOAA; OAR; Pacific Marine
  Environmental Laboratory as part of the Mooring_TAO170W and Mooring_TAO170W0N_Feb2010_Feb2011
  data set. CDIAC associated the following cruise ID(s) with this data set: T17020050704
  and T17020100203nnThe Global CO2 Time-series and Moorings Project involves international
  groups from 18 countries who have mounted sensors on moored buoys to provide high
  resolution time-series measurements of atmospheric boundary layer and surface ocean
  CO2 partial pressure (pCO2). The CO2 Time-series and Moorings Project is coordinated
  by UNESCO International Ocean Carbon Coordination Project (IOCCP).\",\n\t\"license_title\":
